async (fraction, rightanswer, answer) => {
  let moodleResponse = {
    "fraction": fraction,
    "rightanswer": rightanswer,
    "response": answer,
    "completeResponse": true
  };
  let encryptText = await _qlowcode.encryptAnswer(moodleResponse);
  storeValue("moodleResponse", moodleResponse, false);
  storeValue("encryptAnswer", encryptText, false);
  console.log('message----------------------------------------------------------------------------');
  let message = {
    action: 'answer',
    answer: encryptText
  };
  postWindowMessage(JSON.stringify(message), "window", "*");
  console.log(message);
  console.log('message----------------------------------------------------------------------------');
  await _qlowcode.decryptAnswer(encryptText);
  return encryptText;
}

