		page = page.replaceAll("", "n");
		page = page.replace(/[^\x00-\x7F]/g, "");
		page = page.replaceAll(" ", "-");
		page = page.replaceAll("--", "-").toLowerCase();
		console.log(questionId);
		console.log(page);
		console.log(appsmith.URL.pathname);
		console.log(mode);
		if (!appsmith.URL.pathname.includes(page) && mode == "production") {
			console.log("Navigate to: "+questionId);
			navigateTo(questionId);}
